        return (
            <div className="aboutMe">
                <div className="bio">
                    <h4>About Me</h4>
                    <p>Mememememememem emem mememem eme ememem emmememem meme me me. Memememe me ememememem.</p>
                </div>
                <div className="resume">
                    <h4>My Resume</h4>
                    <img src="" alt=""/>

                </div>
            </div>
        );
    }
}

export default AboutMe;
